import React, { useState, useEffect } from 'react';
import axios from 'axios';

import { getResidents } from '../utils/api'; // Import from utils/api.js

function ResidentPortal() {
  const [vehicles, setVehicles] = useState([]);

  useEffect(() => {
    const fetchVehicles = async () => {
      try {
        const token = localStorage.getItem('token');
        const response = await axios.get('/api/residents/vehicles', {
          headers: { Authorization: `Bearer ${token}` },
        });
        setVehicles(response.data);
      } catch (error) {
        console.error('Error fetching vehicles:', error.response.data.message);
      }
    };
    fetchVehicles();
  }, []);

  return (
    <div className="p-8">
      <h1 className="text-3xl font-bold mb-6">Resident Portal</h1>
      <div className="space-y-4">
        {vehicles.map((vehicle) => (
          <div key={vehicle._id} className="bg-white p-4 rounded shadow-md">
            <p><strong>License Plate:</strong> {vehicle.licensePlate}</p>
            <p><strong>Make:</strong> {vehicle.make}</p>
            <p><strong>Model:</strong> {vehicle.model}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default ResidentPortal;
